import React from 'react';
import './DropMenu.css';

const DropMenu = props => {
    return (
        <div>
            <button onClick={props.addWallet}>Add Wallet</button>
            <button onClick={props.removeWallet}>Remove Wallet</button>
        </div>
    )
}

export default DropMenu;
